import styled from 'styled-components';
const ListingsHeaderStyles = styled.div`
    display: flex;
    align-items: center;
    justify-content: flex-start;
    height: 60px;
    padding-left: 30px;
    padding-right: 30px;

    p {
        font-size: 18px;
        flex-grow: 2;
    }
`;

export default ListingsHeaderStyles;
